import React from 'react'
import HandleTextDataToPredict from './HandleTextDataToPredict'
import HandleFeaturesDataToPredict from './HandleFeaturesDataToPredict'
import UploadFile from '../file_handling/UploadFile'
import Container from '@mui/material/Container';
import AppTableModal from '../file_handling/AppTableModal'
import Button from '@mui/material/Button';
import Fab from '@mui/material/Fab';
import InfoRoundedIcon from '@mui/icons-material/InfoRounded';

const HandleDataToPredict = ({classifyingType, onSubmit}) => {
    const [showTextModalTable, setShowTextModalTable] = React.useState(false)
    const [showFeaturesModalTable, setShowFeaturesModalTable] = React.useState(false)


    return (
                    //<div style={{color: themeColor, fontSize: '1.3rem'}}>
        <Container maxWidth='md' sx={{width: "90%", fontSize: "1rem"}}>
                <hr/>
                Upload Excel file so that each line is in the following format:
                <br/>
                {classifyingType === "Text"?
                    <>
                    Text (Numbers) | Class (Numbers or Strings)
                    <br/><br/>
                    <Fab 
                        style={{color: "inherit", backgroundColor: "inherit"}}
                        onClick={() => setShowTextModalTable(true)}
                        size="small" 
                        variant="extended" 
                        color="inherit">
                    <InfoRoundedIcon sx={{ mr: 1 }} />
                    Show Example
                    </Fab>

                    <AppTableModal 
                        show={showTextModalTable}
                        onHide={() => setShowTextModalTable(false)} 
                        title={"File upload example for text classification"}
                        features={["Text"]} 
                        items={[["text1"]]}
                    />
                </>
                :
                <>
                    Features (Numbers)
                    <br/><br/>
                    <Fab 
                        style={{color: "inherit", backgroundColor: "inherit"}}
                        onClick={() => setShowFeaturesModalTable(true)}
                        size="small" 
                        variant="extended" 
                        color="inherit">
                    <InfoRoundedIcon sx={{ mr: 1 }} />
                    Show Example
                    </Fab>

                    <AppTableModal 
                        show={showFeaturesModalTable}
                        onHide={() => setShowFeaturesModalTable(false)} 
                        title={"File upload example for features classification"}
                        features={["Feature 1", "Feature 2", "Feature 3" , "..."]} 
                        items={[["0", "1", "0", "..."]]}
                    />
                </>
                }   
            You Can Enter Text To Predict The Class
            <hr/>
            <HandleTextDataToPredict onSubmit={onSubmit}/>

            <br/>
            You Can Enter Features To Predict The Class
            <hr/>
            <HandleFeaturesDataToPredict 
                features={["feature1", "feature2", "feature3", "feature4"]} 
                onSubmit={onSubmit}
            />

            <hr/>
            <br/>

            Or You Can Upload File To Predict Several Items 
            <hr/>
            
            <UploadFile />
        </Container>
    )
}   

export default HandleDataToPredict
